 insert into gestalt_economic.gestalt_story (story_order,name,url_name, vis_id, intro) values (1,'What tool to use for which data visualization task','visualization-standard',15, 'The proliferation of data visualization tools makes it difficult to know what tool is best suited for what point of the overall visualization workflow. We''ve experimented with many of the available technologies in various environments with varied visualization goals. This is our collection of what we found.');
 insert into gestalt_economic.gestalt_story (story_order,name,url_name, vis_id, intro) values (1,'What visual form best communicates your dataset','tbd',3, 'Choosing the right form for what kind of visual data story you''re trying to craft is vital to comprehension. We''ve experiemented with several different visual forms for different meanings in visual data stories and these are the results.');
 insert into gestalt_economic.gestalt_story (story_order,name,url_name, vis_id, intro) values (2,'Global dependencies and connections in econominc networks.','economic-networks',16,'Global financial systems are interconnected and a series of dependencies and influence. Notice how these groups do something interesting, will put lorem ipsum here if I can''t get info from econ team.');
 insert into gestalt_economic.gestalt_story (story_order,name,url_name, vis_id) values (1,'tbd','tbd',3);
 insert into gestalt_economic.gestalt_story (story_order,name,url_name, vis_id, intro) values (1,'What is economic contagion?','contagion-background',16,'In economics and finance, a contagion can be explained as a situation where a shock in a particular economy or region spreads out and affects others by way of, say, price movements. Description: The contagion effect explains the possibility of spread of economic crisis or boom across countries or regions.');
 insert into gestalt_economic.gestalt_story (story_order,name,url_name, intro) values (3,'A scenario for economic contagion to spread.','contagion-spread', 'In this scenario a shock is introduced to low income oil exporters and note the spread and quarentine boundaries of the crisis.');
 insert into gestalt_economic.gestalt_story (story_order, vis_id, name,url_name, intro) values (1,11,'Classifying anomolies and stuff.','anomolies', 'Some kind of intro/description? More text here to just fill the space assuming there is enough to say about this story.');
